/** Returns true if <code>o</code> is equal to this. */
public boolean equals(Object o) {
  if (this == o) return true;
  if (!(o instanceof Sort)) return false;
  final Sort other = (Sort)o;
  return Arrays.equals(this.fields, other.fields);
}

